create table access_termination (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255) not null, 
employee_code varchar(255), 
end_date date, 
end_date_processed bit, 
limit_to_18_months bit, 
start_date date, 
start_date_processed bit, 
user_type varchar(255) not null, 
primary key (id));

create table client_role (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255), 
section_id bigint, 
role_id bigint, 
user_client_id bigint, 
primary key (id));

create table employee_invitation (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255), 
employee_code varchar(255), 
last_sent_date datetime2, 
primary key (id));

create table feature_code (
id bigint not null, 
code varchar(255) not null, 
description varchar(255), 
is_display_enabled bit not null, 
level varchar(255) not null, 
name varchar(255) not null, 
parent_id bigint, seq_num bigint, 
type varchar(255), 
primary key (id));

create table mapping (
id bigint not null, 
code varchar(255) not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
description varchar(255), 
is_replica bit, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
name varchar(255) not null, 
parent_id bigint, 
is_active bit, 
type varchar(255), 
primary key (id));

create table menu (
id bigint not null, 
category varchar(255), 
description varchar(255), 
display_name varchar(255), 
feature_code_id bigint, 
icon_url varchar(255), 
is_active bit, 
name varchar(255), 
parent_id bigint, 
sequence int, 
type varchar(255), 
url varchar(255), 
primary key (id));

create table privilege (
id bigint not null, 
action varchar(255), 
code varchar(255), 
description varchar(255), 
type varchar(255), 
feature_code_id bigint, 
primary key (id));

create table privilege_mapping (
id bigint not null, 
code varchar(255), 
is_editable bit, 
is_selected bit, 
name varchar(255) not null, 
type varchar(255), 
mapping_id bigint, 
primary key (id));

create table rbac_entity (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
code varchar(255) not null, 
description varchar(255), 
mapping_id bigint, 
name varchar(255) not null, 
is_active bit, 
type varchar(255), 
primary key (id));

create table service_registry (
id bigint not null, 
code varchar(255), 
description varchar(255), 
is_active bit, 
privilege_id bigint, 
service_name varchar(255), 
service_uri varchar(255), 
primary key (id));

create table user_clients (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255) not null, 
client_name varchar(255), 
cost_center_code varchar(255), 
cost_center_desc varchar(255), 
employee_code varchar(255), 
end_date datetime2, 
is_active bit, 
is_i9approver bit, 
is_primary bit, 
new_hire_id bigint, 
remember_timenet_company_id bit, 
remember_timenet_password bit, 
remember_timenet_user_id bit, 
start_date datetime2, 
timenet_company_id varchar(255), 
timenet_password varchar(255), 
timenet_user_id varchar(255), 
user_type varchar(255) not null, 
user_id bigint, 
primary key (id));

create table user_privege_view (
id int not null, 
type varchar(255), 
url varchar(255), 
user_name varchar(255), 
primary key (id));

create table user_rbac_association (
