create table user_toolbar_settings (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255), 
feature_code varchar(255), 
menu_item_id bigint, 
user_email varchar(255), 
primary key (id));

create table users (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
authentication_type varchar(255), 
email varchar(255) not null, 
first_name varchar(255) not null, 
invalid_attempts int, 
is_first_login bit not null, 
is_policy_accepted bit not null, 
is_policy_updated bit not null, 
last_name varchar(255) not null, 
mobile varchar(255), 
password varchar(255), 
token_value varchar(255), 
primary key (id));

create table users_passwords (
id bigint not null, 
created_by varchar(255) not null, 
created_on datetime2 not null, 
modified_by varchar(255) not null, 
modified_on datetime2 not null, 
version bigint, 
client_code varchar(255), 
password varchar(255), 
password_index int, 
user_id bigint, 
primary key (id));

